 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff6600;font-size:37px;\"><B>Pura Dalam</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:22px;\"><B>Panjer</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;\">Pura Puseh, pura dalam, dan Pura Desa Terletak di Banjar Kangin dengan Piodalan Redite Paing Sinta. Pura Desa dan Pura Puseh berdiri sejak tahun 1962 yang dinaungi kurang lebih 8 Banjar desa Adat Pekraman Panjer. Pada tahun 2013 direnovasi secara bersamaan sehingga pada saat direnovasi mengulur waktu hingga kurang lebih 3 tahun.</SPAN></SPAN></DIV></div>",
